// rfce / npm i react-icons

import { ImFacebook2, FaYoutubeSquare, FaYoutube } from 'react-icons/im';

export default function Footer() {
	return (
		<footer className='footer'>
			<h1>SEUGNRI KANG</h1>
			<p>2023 SEUNGRI KANG All rights Reserved</p>
			<ul>
				<li>
					<ImFacebook2 />
				</li>
				<li>
					<FaYoutube />
				</li>
				<li>
					<FaYoutubeSquare />
				</li>
			</ul>
		</footer>
	);
}
